var user_app = angular.module('user.controller', ['ngFileUpload', 'ngImgCrop']);

user_app.controller('userCtrl',
    function ($scope, $location,$timeout,ipCookie, $http,Notification,UserFactory, UploadFactory, UserUpdateFactory, UserHistoryFactory, UserEmailQuery, UserResetPassword, Upload) {
        $scope.hide_form = true;
        $scope.user = UserFactory.get({}, function(resp){
            //convert UST time to local time
            $scope.last_login = new Date(resp.user.last_sign_in_at.replace(/-/g, '/'));
            $('#birthdate').combodate('setValue', resp.user.dob);
        }, function(error) {
            if(error.status == 401){
                window.location.href = "#/";
                Notification.error({message: "Bạn cần phải đăng nhập hoặc đăng ký trước khi tiếp tục.", delay: TIMEOUT});
            }
        });
        $scope.recently_watched = UserHistoryFactory.get();

        // callback for ng-click 'updateProfile':
        $scope.updateProfile = function () {
            //check allowed parameter list before adding new parameter
            var new_params = {name: $scope.user.user.first_name,last_name: $scope.user.user.last_name ,dob: $scope.user.user.dob, address: $scope.user.user.address, gender: $scope.user.user.gender};
            UserUpdateFactory.update(new_params, function (resp) {
                //11000 is success code
                if(resp.code == 11000){
                    Notification.success({message: resp.message, delay: TIMEOUT});
                    setTimeout(function(){
                        window.location.reload();
                    }, 1000);
                }else{
                    Notification.error({message: resp.message, delay: TIMEOUT});
                }
            });
        };

        $scope.changePassword = function(){
            UserResetPassword.change_password($scope.password, function(resp){
                if(resp.code == 11000){
                    Notification.success({message: resp.message, delay: TIMEOUT});
                }else{
                    Notification.error({message: resp.message, delay: TIMEOUT});
                }
            })
        };

        $scope.sendQuery = function(){
            UserEmailQuery.post($scope.query, function(resp){
                if(resp.code == 11000){
                    Notification.success({message: resp.message, delay: TIMEOUT});
                }else{
                    Notification.error({message: resp.message, delay: TIMEOUT});
                }
            });
            $scope.query = {};
        };

        // upload on file select or drop
        $scope.upload = function (file, original_file) {
            if(original_file == null){
                return;
            }
            if($.inArray(original_file.type.toLowerCase(), ["image/jpg", "image/jpeg", "image/png", "image/gif"]) == -1){
                Notification.error({message: "Chọn hình đại diện, hiện DSport đang hỗ trợ định dạng jpeg, png và gif", delay: TIMEOUT});
                return;
            }
            Upload.upload({
                url: API_SERVER + '/update_avatar.json',
                method: 'PUT',
                data: {avatar: file}
            }).then(function (resp) {
                if(resp.data.code == 11000){
                    $scope.user.user.profile_pic = resp.data.user.profile_pic;
                    Notification.success({message: resp.data.message, delay: TIMEOUT});
                    setTimeout(function(){
                        window.location.reload();
                    }, 1000);
                }else{
                    Notification.error({message: resp.data.message, delay: TIMEOUT});
                }
            }, function (resp) {
                Notification.error({message: resp.message, delay: TIMEOUT});
            }, function (evt, resp) {
                var progressPercentage = parseInt(100.0 * evt.loaded / evt.total);
                console.log('progress: ' + progressPercentage + '% ' + evt.config.data.avatar.name);
            });
        };
    }
);

