video_app.controller('videoCtrl',
    function (  $scope,
                $stateParams,
                $location,
                $sce,
                $state,
                ipCookie,
                VideoFactory,
                VideoCommentsFactory,
                UsersWishlistFactory,
                InWishlistFactory,AddToHistoryFactory,
                VideoCommentFactory,
                PoollingFactory,
                Notification,
                RelatedVideosFactory,
                poller,
                VleagueResultFeedFactory,
                VleagueStandingsFactory,
                VideoByKalturaIdFactory
    ) {

        $scope.tabs_data = [{name: "Bình luận", template: 'views/videos/comments_tab.html'}];
        $scope.commentsForm = {};
        $scope.is_ballball = false;


        function get_comments(page, per_page, append){
            var append_to_existing = append || false;
            var comments = VideoCommentsFactory.get({id: $stateParams.id, page: page, per_page: per_page}, function(resp){
                if(append_to_existing){
                    $scope.video_comments = $scope.video_comments.concat(resp.data);
                }
                else{
                    $scope.video_comments = resp.data;
                }

                $scope.video_comments = angular.forEach($scope.video_comments, function(value, index){
                    value.display=true;
                });

                $scope.page = resp.page;
                $scope.total_comments = resp.total_comments;
                if( $scope.total_comments > $scope.video_comments.length){
                    $scope.load_more_comments = true;
                }
                else{
                    $scope.load_more_comments = false;
                }
            });
            return comments;
        }

        RelatedVideosFactory.query({id: $stateParams.id, page: 1, per_page: 10}, function(resp){
            $scope.related_videos = resp.related_videos;
        });

        VideoFactory.show({id: $stateParams.id}, function(resp){
            $scope.host_url_fixtures = $sce.trustAsResourceUrl("widgets/list_widget.html");
            $scope.host_url_tables = $sce.trustAsResourceUrl("widgets/standing.html");
            $scope.host_url_playercompare = $sce.trustAsResourceUrl("widgets/playercompare.html");
            $scope.host_url_teamcompare = $sce.trustAsResourceUrl("widgets/teamcompare.html");

            $scope.video = resp.data;

            if($scope.video.tags != null){
                var video_tags = $scope.video.tags.split(", ");
                if(video_tags.indexOf("ballball") > -1){
                    $scope.is_ballball = true;
                    $scope.ballball_image_url = HOST+"/assets/ballball_logo/ballball.png";
                }
            }


            // ---------- DO NOT DELETE this commented code  ------------------------//

            // ---------------------- DYNAMIC TABS FOR WIDGETS ----------------------//

            if($scope.video.tags != null){
                var video_tags = $scope.video.tags.split(", ");
                // if(video_tags.indexOf("epl") > -1){
                //     var extra_tabs = [{name: "Fixture & Results", template: 'views/videos/fixture_and_results_tab.html'},
                //                     {name: "Standings", template: 'views/videos/standings_tab.html'}];
                //     if(video_tags.indexOf("live") > -1){
                //         extra_tabs = extra_tabs.concat(
                //             [{name: "Player Comparison", template: 'views/videos/player_compare_tab.html'},
                //              {name: "Team Comparison", template: 'views/videos/team_compare_tab.html'}]
                //         );
                //     }
                //     $scope.tabs_data = $scope.tabs_data.concat(extra_tabs);
                // }else
                if(video_tags.indexOf("v-league") > -1){
                    var extra_tabs = [{name: "Lịch & Kết Quả", template: 'views/videos/fixture_and_results_tab.html'},
                        {name: "Bảng Xếp Hạng", template: 'views/videos/standings_tab.html'}];
                    $scope.tabs_data = $scope.tabs_data.concat(extra_tabs);
                    VleagueResultFeedFactory.query({}, function success(response) {
                        $scope.grouped_fixtures = response.fixtures;
                        $scope.grouped_results = response.results;
                    }, function err() {});

                    VleagueStandingsFactory.query({}, function(resp){
                        $scope.team_standings = resp.data;
                    });
                }
            }

            // ------------------ DO NOT DELETE above commented code -----------------//

            $scope.updated_at = resp.last_updated;
            $scope.no_desc = "No description";
            // $scope.entry_id = resp.data.kaltura_id

            $scope.kalturaPlayer(resp.data.kaltura_id, $scope.is_ballball);

            //Get video comments
            get_comments(1,10);

            //update video comments after 10 sec interval
            // PoollingFactory.callFnOnInterval(function () {
            //     get_comments(1,10);
            // });

            var myPoller = poller.get(
                VideoCommentsFactory,
                {
                    action: 'get',
                    delay: 60000,
                    argumentsArray: [
                        {
                            id: $stateParams.id, page: 1, per_page: 10

                        }
                    ]

                }
            );

            myPoller.promise.then(null, null, function(resp) {
                if (resp.data.length != 0 && resp.data[0].updated_at != $scope.video_comments[0].updated_at){
                    $scope.video_comments = resp.data;
                    $scope.video_comments = angular.forEach($scope.video_comments, function(value, index){
                        value.display=true;
                    });

                    $scope.page = resp.page;
                    $scope.total_comments = resp.total_comments;
                    if( $scope.total_comments > $scope.video_comments.length){
                        $scope.load_more_comments = true;
                    }
                    else{
                        $scope.load_more_comments = false;
                    }
                }
            });

            if($scope.user.signedIn == true){
                InWishlistFactory.get({video_id:resp.data.id},function(resp){
                    $scope.in_wishlist = resp.in_wislist
                });

                //Add video to watched list
                AddToHistoryFactory.post({video_id:resp.data.id})
            }
        });



        $scope.kalturaPlayer = function(entry_id, is_ballball){
            if( isMobile.any() && is_ballball){
                kalturaPlayerID = BALLBALL_PLAYER_UICONF_ID;
            }else{
                kalturaPlayerID = PLAYER_UICONF_ID;
            }

            kWidget.embed({
                "targetId": "kaltura_player_0987654321",
                "wid": PLAYER_WID,
                "uiconf_id": kalturaPlayerID,
                "flashvars": {
                    "strings" : {
                        "ks-OUT_OF_SCHEDULING_TITLE" : "lỗi",
                        "ks-OUT_OF_SCHEDULING" : "Trận đấu này hiện đang chưa diễn ra! Bạn xem lịch thi đấu để biết giờ bóng lăn nhé!"
                    },
                    "share": {
						"socialShareURL": window.document.URL,
						"plugin": true
                    },
                    "LeadWithHLSOnFlash": false,
                    "streamerType": "auto",
                    "EmbedPlayer.NotPlayableDownloadLink" : "false",
                    'autoPlay': true
                },
                "entry_id": entry_id,
                "readyCallback": function( playerId ){
                    var kdp = $('#' + playerId)[0];
                    kdp.kBind( 'relatedVideoSelect', function( relatedData ){
                        VideoByKalturaIdFactory.get({video_id: relatedData.entryId}, function(resp){
                            if(resp.code == 11000){
                                $state.transitionTo('video', {'id': resp.video.slug});
                            }else{
                                Notification.error({message: resp.message});
                            }
                        });
                    });
                }
            });
        }

        $scope.add_to_wishlist = function(video_id){
            UsersWishlistFactory.post({video_id:video_id},function(resp){
                if(resp.status == "success"){
                    $scope.in_wishlist = true
                }
            })
        }

        $scope.postComment = function(comment){
            var post_params = angular.extend(comment, {id: $stateParams.id})
            VideoCommentsFactory.post(post_params, function(resp){
                resp.comment.display=true;
                $scope.video_comments.unshift(resp.comment);
                $scope.total_comments = $scope.total_comments + 1;
                $scope.commentsForm = {};
            });
        }

        $scope.updateComment = function(comment_id, comment_body){
            VideoCommentFactory.update({id: comment_id, body: comment_body}, function(resp){
                if(resp.status == "Success"){
                    Notification.success({message: "Bình luận đã được cập nhật.", delay: 2000});
                }
                else{
                    Notification.error({message: resp.message});
                }
            });
        }

        $scope.deleteComment = function(comment_id, index){
            VideoCommentFactory.delete({id: comment_id}, function(resp){
                if(resp.status == "Success"){
                    $scope.video_comments.splice(index,1);
                    $scope.total_comments = $scope.total_comments - 1;
                    Notification.success({message: "Bình luận đã được xóa.", delay: 2000});
                }
                else{
                    Notification.error({message: resp.message});
                }
            });
        }

        $scope.loadMore = function(page, total_results){
            $scope.page = parseInt($scope.page) + 1;
            get_comments($scope.page, 10, true);
        }
    }
);
