var notification_app = angular.module('notifications.controller', []);

notification_app.controller('notificationsCtrl', function($scope, $window, $rootScope, $location, NotificationsFactory, NotificationFactory, NotificationsResetFactory){
    function get_notifications(page, per_page, append){
        var append_to_existing = append || false;
        var notifications = NotificationsFactory.get({page: page, per_page: per_page}, function(resp){
            $scope.new_notifications_count = resp.new_notifications_count;
            if($scope.new_notifications_count != 0){
                $scope.hide_notification_badge = false;
            }

            if(append_to_existing){
                $scope.notifications = $scope.notifications.concat(resp.data);
            }
            else{
                $scope.notifications = resp.data;
            }

            $scope.noti_page = resp.page;
            $scope.total_notifications = resp.total_notifications;
            if( $scope.total_notifications > $scope.notifications.length){
                $scope.load_more_notifications = true;
            }
            else{
                $scope.load_more_notifications = false;
            }

        });

        return notifications;
    }
    $scope.hide_notification_badge = true;
    if($scope.user.signedIn){
        get_notifications(1,10);
    }

    $scope.toggle_notification_panel = function(){
        if(!$scope.hide_notification_badge){
            NotificationsResetFactory.update({}, function(resp){

            });
        }
        $scope.hide_notification_badge = true;
        $('div.notipanel').slideToggle();
        $('#cbp-hrmenu .cbp-hrsub').fadeOut();
    }

    $scope.openNotification = function(notification){
        var redirect_url;
        $('div.notipanel').slideToggle();
        $('.slimmenu').hide();

        if(notification.notification_type=="internal"){
            redirect_url = "/#/watch/" + notification.target_url;
            $window.open(redirect_url, '_self');
        }
        else{
            redirect_url = notification.target_url;
            $window.open(redirect_url, '_blank');
        }

        if(!notification.read){
            NotificationFactory.update({id: notification.id}, function(resp){
                if(resp.code == 11000){
                    angular.forEach($scope.notifications, function(obj){
                        if(obj.id == notification.id){
                            obj.read=true;
                        }
                    });
                }else{
                    console.log(resp.message);
                }
            });
        }

    }

    $scope.loadMore = function(page, total_results){
        $scope.load_more_notifications = false;
        $scope.noti_page = parseInt($scope.noti_page) + 1;
        get_notifications($scope.noti_page, 10, true);
    }

});
